import React from "react";
import PropTypes from "prop-types";

const Helmet = (props) => {
  document.title =
    "Future House: The best household distrubutor " + props.title;

  React.useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return <div>{props.children}</div>;
};

Helmet.propTypes = {
  title: PropTypes.string.isRequired,
};

export default Helmet;
